import React,{ useEffect, useState } from 'react';
import './app.css';
import Videolist from './componets/video_list/video_list';

function App() {
  const [videos, setVideos] = useState([]);
  
  useEffect(() => {
    const requestOptions = {
      method: 'GET',
      redirect: 'follow'
    };
    
    fetch("https://www.googleapis.com/youtube/v3/videos?part=snippet&chart=mostPopular&maxResults=25&key=AIzaSyAdKiYBVAtwzpuVYaDwwpcq71x2Z4urqv0", requestOptions)
    .then(response => response.json())
    .then(result => console.log(result))
    .then(result=> setVideos(result))
    

    .catch(error => console.log('error', error));
  }, []);
  console.log(videos);

  return <Videolist videos={videos} />;
  
}

export default App;
